import logo from './logo.svg';
import './App.css';

//importar componente
import CompShowPc from './inventario/ShowPc'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <CompShowPc></CompShowPc>
    </div>
  );
}

export default App;
